const initialState = {
    title: "This is the title",
    OperationList: [
       {
           id:0,
           cards:[
               {id:0},
               {id:1}
           ]
       },
       {
        id:1,
        cards:[
            {id:0},
            {id:1}
        ]
        }
    ]
}

const rootReducer = (state = initialState, action) =>{
    return state;
}

export default rootReducer;
